import React from "react";

const PartyInfo = () => {
  return (
    <div className="party-info">
      <div className="party-dresscode">
        <div className="party-info-image"></div>
        <h2 className="party-info-title"></h2>
        <button type="button" className="party-info-button"></button>
      </div>
      <div className="party-music"></div>
      <div className="party-no-kids-allowed"></div>
      <div className="party-gifts"></div>
    </div>
  );
};

export default PartyInfo;
